import * as React from 'react'; 
import { View, Image, ImageBackground, StyleSheet, Text, TextInput, Alert, ScrollView} from 'react-native';
import { Dimensions, StatusBar } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';
import { TabView, SceneMap, TabBar } from 'react-native-tab-view';

const GruposRoute = () => (
  <View style={[styles.scene, { backgroundColor: '#FFF' }]}>
  <View style={styles.bodyRecomendacao}>
          <ScrollView>
          <RectButton style={styles.boxJogo}>
            <Text style={styles.txtBoxTopoJogo}>Os Campeões do Fortnite</Text>
            <Image style={styles.imgBoxJogo} source={require('../../assets/images/fortniteIMG.png')} />
            <View style={styles.txtBoxJogo}>
              <Text style={styles.txtBoxFimJogo}>Jogadores: 3/4</Text>
              <Text style={styles.txtDataBox}>Data de Criação: 22/08/2022</Text>
              <Text style={styles.txtBoxFimJogo}>Jogo: Fortnite</Text>
              <Text style={styles.txtBoxFimJogo}>Criador: Gwen</Text>
            </View>
            </RectButton>

          </ScrollView>
        </View>
  </View>
);
const JogadoresRoute = () => (
  <View style={[styles.scene, { backgroundColor: 'blue' }]}><Text>Banana</Text></View>
);


export default function ResultadoPesquisa() {

  const navigation = useNavigation();
  const [index, setIndex] = React.useState(0);

  function handleNavigationToPerfil() {
    navigation.navigate('Perfil');
  }

  state = {
    index: 0,
    routes: [
      { key: 'Grupos', title: 'Grupos' },
      { key: 'Jogadores', title: 'Jogadores' },
    ],
  };

  return (
    <View style={styles.container}>

      <ImageBackground source={require('../../assets/images/fundo-login.png')}
        style={styles.imgFundo}>
        <View style={styles.topoPesquisa}>
          <View>
          <View style={styles.viewPesquisar}>

          <TextInput 
              style={styles.input} 
              autoCapitalize="characters" 
              autoCorrect={false} 
          /> 
          <RectButton style={styles.buttonInput} > 
                <Image style={styles.imgLupa} source={require('../../assets/images/lupa.png')} />
            </RectButton>
          </View>
          </View>
        </View>
        <View style={styles.bodyPesquisa}>
          <TabView
          navigationState={this.state}
          renderScene={SceneMap({
            Grupos: GruposRoute,
            Jogadores: JogadoresRoute,
          })}
          onIndexChange={index => setIndex(index)}
          initialLayout={{ width: Dimensions.get('window').width }}
          style={styles.map}
          renderTabBar={props => <TabBar {...props} style={{backgroundColor: '#1261FF', color:'#000'}}/>}
          />

        <View style={styles.menu}>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/home-ativo.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/chat.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu}>
              <Image style={styles.imgMenu} source={require('../../assets/images/notificacao.png')} />
            </RectButton>
            <RectButton style={styles.btnMenu} onPress={handleNavigationToPerfil}>
              <Image style={styles.imgMenu} source={require('../../assets/images/perfil.png')} />
            </RectButton>
          </View>
        </View>
      </ImageBackground>

    </View>
  );
}

